window.bookSummaryJSON = "<p>\"<i>1984 </i>and <i>Brave New World</i> meets Narnia\"</p> <p>Cities have been replaced by technates. It is a world of soaring apartments, hundreds of stories high, where technology measures, monitors, and rations to meet the needs of the greater populace. It is a world of drones, in the air and on the ground, and advanced robotic beings who carry out much of the harder labor, security, and even pleasure assignments.</p> <p>Those discontent, or who resist, are taken to rehabilitation centers, established after the embrace of the greater good doctrine.</p> <p>For most, virtual realms, substances, and entertainment provide escapes, but for Haven, Cayden, Jaelynn, and Salvador, growing up in Technate Six is a restless existence.</p> <p>A hunger for something more gnaws inside each of them. Discoveries await that open the gates to transcend time and space, and even new planes of existence. Nothing in their universe, or others, is impossible to explore.</p> <p>What was once reality, now seems like an illusion in a deepening experience.</p> <p>Begin the journey to Faraway, in <i>Dream of the Navigator</i>, the first book of the Faraway Saga!</p>"; 
